class Solution:

    def findValidSplit(self, nums: List[int]) -> int:
        for i in range(len(nums) - 1):
            product_left = 1
            for j in range(i + 1):
                product_left *= nums[j]
            product_right = 1
            for j in range(i + 1, len(nums)):
                product_right *= nums[j]
            if gcd(product_left, product_right) == 1:
                return i
        return -1

